import React, { Component } from "react";

import { Row, Col, Card, Button, Icon, Progress } from "antd";

import Parent from "./React";
const DataSet = require("@antv/data-set");






class Child2 extends React.Component {
 constructor(props) {
    super(props);
   this.state = {
     value_pie :'',
     count:0,
     name:''
   };
   this.test = this.handleSubmit.bind(this);
 }

 handleSubmit = (e) => {
    e.preventDefault();
    this.setState({count:'sjkfkasdhfkasdhfksnk'});
    this.setState({name:'mokka ravi'});
 };

render() {
      return (
            <div>
               <span>{this.state.count}</span>

                <Parent trigger= {this.handleSubmit}  name = {this.state.name}/>

            </div>

        );
    }
}
export default Child2;
